(function(){
  'use strict';

  // The main app
  angular
      .module('msp.app', ['ngSanitize', 'ngMaterial', 'lfNgMdFileInput', 'ngAnimate', 'ngResource',
        'msp.core', 'msp.users', 'msp.posts', 'msp.pages.feed', 'msp.pages.timeline', 'msp.pages.publish_game','sticky'])
      .config(function($mdThemingProvider){
	      $mdThemingProvider.theme('default')
	          .primaryPalette('teal')
	          .accentPalette('red');
      })
      .value('API_URL', window.location.protocol + '//' + window.location.hostname + ':1337')
      .run(function($mdDialog) {
        var modalhtml = ''
        + '<div style="text-align:center">'
        + '<p>We have analyzed your Twitter account and found your <strong>Personality Insights</strong> as below</p>' 
        
        + '<img style="display: inline-block; max-width: 263px" src="'
        + 'data:image/png;base64,'
        + '">'
         
        + '<p>Based on the research <a target="_blank_" href="http://csus-dspace.calstate.edu/bitstream/handle/10211.9/1807/Thesis%20final.pdf?sequence=1">here</a> we will deliver to you games that are mostly in the categories: </p>' 
        + '<p><strong>"action-non shooters", "puzzle", "adventure".</strong></p>'
        + '</div>'
        ;
         
          var introStarted;
          $mdDialog.show({
            template:
              
              '<md-dialog>' +
              '  <md-dialog-content class="md-dialog-content" style="text-align: center">' 
              + '<img style="display: inline-block; max-width: 30px" src="'
              + 'data:image/png;base64,'
              + '">' +

              '</md-dialog-content>' +
              '  <md-dialog-actions style="text-align:center; padding: 5px">' +
              '    <md-button ng-click="closeDialog()" class="md-primary">' +
              '      Judge, click here to sign in with our fake twitter account' +
              '    </md-button>' +
              '  </md-dialog-actions>' +
              '</md-dialog>',
            controller: function($scope) {
              $scope.closeDialog = function() {
                // Easily hides most recent dialog shown...
                // no specific instance reference is needed.
                $mdDialog.hide();
              };
            },
            onComplete: function() {
              $('.md-dialog-container').css('background-color','#000');
            },
            onRemoving: function() {
              $mdDialog.show({
                  template:
                    '<md-dialog>' +
                    '  <md-dialog-content class="md-dialog-content"> <h2>Hello!</h2>' + modalhtml +'</md-dialog-content>' +
                    '  <md-dialog-actions>' +
                    '    <md-button ng-click="closeDialog()" class="md-primary">' +
                    '      Nice!' +
                    '    </md-button>' +
                    '  </md-dialog-actions>' +
                    '</md-dialog>',
                  controller: function GreetingController($scope, $mdDialog) {
                    $scope.closeDialog = function() {
                      // Easily hides most recent dialog shown...
                      // no specific instance reference is needed.
                      $mdDialog.hide();
                    };
                  },
                  onComplete: function() {
                    $('.md-dialog-container').css('height',$(window).innerHeight() + 'px');
                    $('html,body').scrollTop(0);
                  },
                  onRemoving: function() {
                    var interval = setInterval(function() {
                      if($('md-toolbar .md-button[href="#/"]')[0] && $('md-toolbar .md-button[href="#/publish_game"]')[0]) {
                        clearInterval(interval) ;
                        setTimeout(function() {
                          $('md-toolbar .md-button[href="#/"]').attr('data-intro','You\'re at the Game Feed. Scroll to a game to immediately play it.');
                          $('md-toolbar .md-button[href="#/publish_game"]').attr('data-intro','This is where you publish your game. You can give us a URL to where your game is hosted or upload a zip file containing your entire game.');
                          introStarted || introJs().start();
                          introStarted = true;
                          // debugger;
                        }); 
                      }
                      
                    },50);
                    
                  }
                });
            }
          });


          

          
        
        
      });


   

})();
